import React from 'react';
import styled from 'styled-components';

const Search = () => {
  return (
    <Wrapper>
      <TextInput />
      <SubmitBtn>Search</SubmitBtn>
    </Wrapper>
  );
};

const Wrapper = styled.form`
  width: 100%;
  display: flex;
`;
const TextInput = styled.input`
  width: 100%;
`;
const SubmitBtn = styled.button``;

export default Search;
